sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var p7 = inputs.parts1;
  var p8 = inputs.parts2;
  var p9 = inputs.parts3;
  var p10 = inputs.parts4;
  var p11 = inputs.parts5;


  var sp = inputs.split;

  var splitP7 = p7.split(sp);
  var splitP8 = p8.split(sp);
  var splitP9 = p9.split(sp);
  var splitP10 = p10.split(sp);
  var splitP11 = p11.split(sp);


outputs.olabel1 = splitP7[0].replace(/\s/g, '');
outputs.ovalue1 = splitP7[1];

outputs.olabel2 = splitP8[0].replace(/\s/g, '');
outputs.ovalue2 = splitP8[1];

outputs.olabel3 = splitP9[0].replace(/\s/g, '');
outputs.ovalue3 = splitP9[1];

outputs.olabel4 = splitP10[0].replace(/\s/g, '');
outputs.ovalue4 = splitP10[1];

outputs.olabel5 = splitP11[0].replace(/\s/g, '');
outputs.ovalue5 = splitP11[1];


})(inputs, outputs);

