sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var appName = inputs.str;

var sp = inputs.split;

var countParts = (appName.match(/:/g) || []).length;

var partsArray = appName.split(sp);



var parts1 = partsArray[0];
var parts2 = partsArray[1];
var parts3 = partsArray[2];
var parts4 = partsArray[3];
var parts5 = partsArray[4];



outputs.parts1 = parts1;
outputs.parts2 = parts2;
outputs.parts3 = parts3;
outputs.parts4 = parts4;
outputs.parts5 = parts5;

})(inputs, outputs);

